import { NavLink } from "react-router-dom";
import { FaShoppingCart } from "react-icons/fa";

const Navbar = () => {
  return (
    <div className="bg-slate-900 py-2">
      <div className="flex justify-between max-w-[1080px] w-screen">
        <NavLink to={"/"}>
          <img src="../logo.png" alt="Logo" className="w-[130px]" />
          <img />
        </NavLink>

        <div>
          <NavLink to={"/"}>
            <img src="" alt="home logo" />
          </NavLink>
          <NavLink to={"/cart"}>
            {/* <img src="../public/favicon.ico" alt="cart logo" /> */}
            <FaShoppingCart/>
          </NavLink>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
